# Used to visualize data gathered from testing
import matplotlib.pyplot as plt
import inspect

# Method to return a variable name as a string
def retrieve_name(var):
    callers_local_vars = inspect.currentframe().f_back.f_locals.items()
    return [var_name for var_name, var_val in callers_local_vars if var_val is var]


# method to plot time stamp data
def plot_title(var_name):
	# Construct plot title
	name_list = var_name[0].split('_')
	print(name_list)
	if name_list[1] == 'n':
		model = 'naive'
	elif name_list[1] == 'gc':
		model = 'Gradient Coding'
	else:
		model = 'Straggler'
	if name_list[0] == 'send':
		name = 'Sending'
	else:
		name = 'Receiving'
	title = name + ', ' + model + ', Len: ' + name_list[2] + ', Iter: ' + name_list[3]
	return title


# Creates an x vector of the right length for time stamp data
def x_vector(var):
	x = range(1, len(var)+1)
	return x


